import { useState } from "react";
import { RangeSlider } from "reactrangeslider";

const SliderRange = () => {
  const value = { start: 20, end: 80 };
  const [lowerVal, setLowerVal] = useState(0);
  const upperSlider = (
    <input type="range" min="0" max="50" value="45" id="upper" />
  );
  const lowerSlider = (
    <input
      onChange={(e) => setLowerVal(e.target.value)}
      type="range"
      min="0"
      max="50"
      value="5"
      id="lower"
    />
  );

  return (
    <div>
      <span class="multi-range">
       {lowerSlider}
       {upperSlider}
      </span>{" "}
    </div>
  );
};

export default SliderRange;
